INSERT INTO `yeu_cau` (`ma_yeu_cau`, `ten_yeu_cau`, `mo_ta`, `giay_to`, `le_phi`, `tinh_trang`) VALUES
(1, 'Cấp mới', 'Là yêu cầu mà người dân lần đầu tiên làm căn cước công dân', 'Giấy hẹn làm Căn cước công dân, Hộ khẩu bản chính (hoặc bản sao có công chứng), Phí chụp ảnh làm thẻ.', 0, 1),
(2, 'Cấp đổi', 'Là yêu cầu mà thẻ căn cước công dân của người dân bị mờ hình ảnh, chữ số, rách, thay đổi hình dạng nhận diện, có nhu cầu đổi lại thẻ mới ...', 'Giấy hẹn làm Căn cước công dân, Thẻ CMND/CCCD cũ, phí chụp ảnh làm thẻ', 7000, 1),
(3, 'Cấp lại', 'Là yêu cầu mà khi người dân làm mất thẻ.', 'Giấy hẹn làm Căn cước công dân, Hộ khẩu bản gốc (hoặc bản sao có công chứng), Phí chụp ảnh làm thẻ.', 12000, 1);
